import './App.css';
import Board from './components/Board'
import Controls from './components/Controls';
import { TableTop, Robot } from './utils/Classes';

const robot = new Robot()
const tableTop = new TableTop(robot)

robot.place()
console.log(robot)
console.log(tableTop.grid)


function App() {
  return (
    <div className="App">
      <aside>
        <Controls />
      </aside>
      <main>
        <Board
          grid={tableTop.grid}
        />
      </main>


    </div>
  );
}

export default App;
